// import router from '@/router';

const ProductModules = () => import('./ProductModules.vue');
const ProductsPage = () => import('./page/ProductsPage.vue');
const BrandPage = () => import('./page/brand/BrandPage.vue');
const BrandAddPage = () => import('./page/brand/BrandAddPage.vue');
const BrandEditPage = () => import('./page/brand/BrandEditPage.vue');
// const CategoryPage = () => import('./page/categories/CategoryPage.vue');
// const SubCatPage = () => import('./page/subcategories/SubCategoryPage.vue');

const moduleRoute = {
    path: "/admin/products",
    component: ProductModules,
  
    children:[
        {
            path: "/admin/products",
            component: ProductsPage,
        },
        {
            path: "/admin/products/brand",
            component: BrandPage,
        },
        {
            path: "/admin/products/brand-add",
            component: BrandAddPage,
        },
        {
            path: "/admin/products/brand-edit",
            name:'admin-brand-edit',
            component: BrandEditPage,
        },
        // {
        //     path: "/admin/products/category",
        //     component: CategoryPage,
        // },
        // {
        //     path: "/admin/products/sub-catetory",
        //     component: SubCatPage,
        // },
    ]
};
export default router => {
    router.addRoute(moduleRoute);
    // console.log(router.getRoutes());
  };
